column7:
Был в параллели C' Летней Компьютерной Школы, 
участие в городской олимпиаде по программированию в ИТМО;
диплом в городской олимпиаде по информатике в ИТМО;
диплом 3 степени в командной олимпиаде по программированию "Турнир Архимеда";
По причине обучения в Физико-Математическом лицее постоянно участвую в городских и региональных олимпиадах и конкурсах по математике, физике и программированию. Имею дипломы. Участвую в интернет - олимпиадах.

Да участвовал в: 
Крок (http://robots.croc.ru/junior/);
Робофест (http://www.russianrobofest.ru/);
Местные Соревнования Лиги Роботов (http://ligarobotov.ru/);
